旗魚圖騰屹立於豆腐岬風景區入口處旁，豆腐岬原被規劃為漁船出入港，但因蘇澳颱風東向西吹，港口向東，如此一來港內居民首當其衝，因此作罷。本座圖騰建於西元1995年，由蘇澳國際獅子會興建，日本北九州東國際獅子會協建，上書「漁群豐收」。而圖騰造型以一隻立翅旗魚飛躍水面、凌空而出之姿，情牽中日民間友誼，輝映日據時期一路至今的一段鏢旗魚史。現今南方澳每到鏢旗魚季，鏢丁挽高手的港邊男兒，莫不期待一如他們的船名「全滿載」、「金吉利」一樣，期望海洋給予他們漁群豐收!

